import React from "react";
import Lay from "./LayoutFull/Lay";
import Dasboard from "./Component/Navbar/Dasboard";
import Journal from "./Component/Journal/Journal";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Navbar from "./Component/Navbar/Navbar";
import GeneralJournal from "./Component/GeneralJournal";



function App (){
  return(
    <div>

    <Router>
      <Routes>
        <Route  path="/dasboard" element={<Dasboard/>}/>
        <Route  path="/lay" element={<Lay/>}/>
        <Route  path="/navbar" element={<Navbar/>}/>
        <Route  path="/journal" element={<Journal/>}/>
        <Route  path="/generaljournal" element={<GeneralJournal/>}/>



      </Routes>
    </Router>

    </div>
  );
}



export default App;
